import React, { useEffect, useState } from "react";
import "./App.css";
import { getTodos } from "./api";

function App() {
  const [todos, setTodos] = useState([]);
  useEffect(() => {
    getTodos().then((data) => setTodos(data));
  }, []);
  return <div>{todos.map((todo) => todo.name)}</div>;
}

export default App;
